import "./peoplecard.css" ;
class PeopleCard extends React.Component{

  render(){
  return(
    <div className="peoplecard">
      <div className="picture"> <img href='https://i.ytimg.com/vi/ANxvQHuW9S8/maxresdefault.jpg' /> </div>
        <div className="info">

          <h2>  {/* this.props.item.name*/}   </h2> <h2> location </h2>
          <h3> price </h3>

          <button id="button" >more details</button>
      </div>

    </div>

  )
  }
}

export default PeopleCard;
